Does course DIT247 cover the transformer.model_7:
No, the course covers the following broad areas: 
•working with text data, including fundamental tasks such as tokenization and word counting;
•probabilistic models for text, such as topic models;
•overview of the most common types of nlp applications;
•architectures for representation in nlp models, including word embeddings, convolutional and recurrent neural network, and attention models;
•machine learning models for common types of nlp problems, mainly categorization, sequence labeling, structured prediction and generation; and
•approaches to transfer learning in nlp.

